import React from 'react'
import TopNav from './TopNav'

{/*
<TopNav>
<3 buttons yt own mountnPlay> onClick-> style.display = none/block >
< for each of the three buttons -> a seperate component > 
*/}

class PlayField extends React.Component {
    render(){
        return(
            <div className="container-fluid">
                <TopNav/>
                <div className="row" style={{padding:'10px', backgroundColor:'transparent', border:'1px solid black', borderStartEndRadius:'10px'}}>
                    <div className="col-sm-2"><button style={{
                        border:'0px',
                        color:'inherit',
                        backgroundColor:'transparent',
                        borderRadius:'5px',
                        border:'1px solid black',
                        }}> Youtube Audio Books</button></div>

                    <div className="col-sm-2"><button style={{
                        border:'0px',
                        color:'inherit',
                        backgroundColor:'transparent',
                        borderRadius:'5px',
                        border:'1px solid black',
                        }}>Our Library</button></div>

                    <div className="col-sm-2"><button style={{
                        border:'0px',
                        color:'inherit',
                        backgroundColor:'transparent',
                        borderRadius:'5px',
                        border:'1px solid black',
                        }}> Mount and Play</button></div>
                    <div className="col-sm-3"></div>                    
                    </div>
                </div>

        )
    }
}

export default PlayField;
